import React from 'react';
import Link from 'next/link';
import styled from 'styled-components';

import Header from '../styles/Header';

const HopSelection = () => {
  return (
    <div>
      <Header />
      <NavigationBar>
        <Title>Starhop</Title>
        <Link href="/about">
          <a>About</a>
        </Link>
      </NavigationBar>
    </div>
  );
};

export default HopSelection;
